import styled from "styled-components";

const HeaderStyles = styled.div`
  display: flex;
  background: white;
  border-bottom: 1px solid rgb(219, 219, 219);
  height: 60px;

  .headerLeft,
  .headerRight {
    display: flex;
    font-family: "Oleo Script", cursive;
    align: center;
  }

  .headerLeft {
  }

  .headerRight {
    margin-left: auto;
  }

  .shopifyLogo {
    width: 5vw;
  }
`;

const Styles = {
  HeaderStyles: HeaderStyles,
};

export default Styles;
